window.bookSummaryJSON = "<p>Finding out your serial killer dad wants you to un-alive your boyfriends … Well, it sucks.</p> <p>Even worse if one of those guys is lying when he says he loves you.</p> <p>The worst when two of them are lying to your face. If all three of them do it … game over.</p> <p>I might be known as Gamer Girl, but I wasn’t prepared for this.</p> <p>Choice and betrayal. Romance and death. Mostly, consequences and hard truths.</p> <p>Coming out of this alive will be a miracle; surviving with my heart intact is impossible.</p> <p>Oh, and my summer vacation? Total disaster. The beginning of junior year? Complete nightmare.</p> <p>My wedding … it’s a bloodbath.</p> <p>Maxx, Parrish, Chasm: I thought you guys had my back?!</p> <p>Whatever.</p> <p>Romance is so overrated.</p> <p>Fresh graves will be dug in Medina; the body count will be high. New players will enter the game as the stakes rise, a crescendo of opulence and violence. There are actions I’ll take that I should’ve taken from the beginning, actions that will turn out differently than I ever could’ve imagined.</p> <p>Who wants to help me catch a serial killer?</p> <p>Checkmate, Dad.</p> <p>It’s game over.</p> <p>GAME OVER BOYS is a 346,000 word love-hate/high school romance with suspense/thriller themes. This is a reverse harem novel, meaning the main character has more than one love interest. This is book four of four, and it completes the series.</p>"; 
